import React, { useEffect } from "react";
import Header from "../Header/Header";
import bg from "../../Assets/medicalBG.png";
import "./Home.css";
import { gsap } from "gsap";
function Home() {
  const el = React.useRef();
  const q = gsap.utils.selector(el);
  const tl = React.useRef();

  useEffect(() => {
    tl.current = gsap
      .timeline()
      .to(q(".title"), {
        x: 400,
      })
      .to(q(".description"), {
        x: 400,
      });
  }, []);
  return (
    <>
      <Header />
      <div className="home">
        <div className="container" ref={el}>
          <h1 className="title" ref={tl}>
            ME-Inspection
          </h1>
          <p className="description">
            Lorem Ipsum Lorem IpsumLorem IpsumLorem IpsumLorem Ipsum. Lorem
            IpsumLorem IpsumLorem IpsumLorem IpsumLorem IpsumLorem Ipsum Lorem
            IpsumLorem IpsumLorem IpsumLorem IpsumLorem IpsumLorem Ipsum.
          </p>
        </div>
        <div className="home__image">
          <img src={bg} alt="bg"></img>
        </div>
      </div>
    </>
  );
}
export default Home;
